import logo from './logo.svg';
import './App.css';

import catimg from "./cat.png";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}


        <h1>Welcome to Katsu!</h1>
      </header>

      <div class = "navbar">
        <div class="navbar_element">
          <a href="#"><img src={catimg} alt="Discover"></img></a>
        </div>

        <div class="navbar_element">
          <a href="#"><img src={catimg} alt="Resources" ></img></a>
        </div>

        <div class="navbar_element">
          <a href="#"><img src={catimg} alt="About"></img></a>
        </div>
      </div>

      <div class="content">
        <p> Welcome to katsu! your very own one-stop-search site for cute cats!</p>
        <h1>Look around to see for cool things or search for something!</h1>

        <h1>Search</h1>
        <input id="searchbar" onkeyup="query_cat()"  type="text" placeholder="small cat drinking pineapple juice.."></input>
        <button>Search!</button>
        {/* <script src="test.js"></script> */}

        <h1>Results</h1>

        <div class="results"></div>
      </div>


    </div>
  );
}

export default App;
